var ComingSoon=function(){
	return{
		init:function()
		{
			var e=new Date;
			e=new Date(e.getFullYear()+1,0,26),
			$("#defaultCountdown").countdown({until:e}),
			$("#year").text(e.getFullYear()),
			$.backstretch([
				"../../../includes/assets/img/bg/1.jpg"],
				{fade:1e3,duration:1e4}
				)
		}
	}
}();
jQuery(document).ready(function(){ComingSoon.init()});